Стандарт 3166-2 — часть стандарта ISO 3166, изданного Международной организацией по стандартизации и определяющего геокоды для основных единиц первого или первого и второго уровня административно-территориального деления территории всех стран. Впервые стандарт был опубликован в 1998 году. Не следует путать со стандартом ISO 3166-1, в котором содержатся коды названий государств и зависимых территорий, включенных в бюллетень ООН для использования статистическим отделом ООН. Геокоды стандарта ISO 3166-2 созданы на основании исходных данных национальных органов статистики, географии, стандартизации и других органов и организаций, полномочных представлять исходные данные административно-территориального деления территории государства. Цель стандарта ISO 3166-2 состоит в установлении международного стандарта коротких и уникальных алфавитно-цифровых геокодов, представляющих соответствующие административно-территориальные единицы всех стран в более удобной и менее неоднозначной форме, чем их полные имена. Каждый код по ISO 3166-2 состоит из двух частей, разделённых дефисом: 
* первая часть геокода представлена кодом государства по стандарту ISO 3166-1 Alpha2 (также обозначающим национальные домены верхнего уровня); 
* вторая часть — одно-, двух- или трёхсимвольный код из букв или цифр. Обычно буквенный код образован созвучно или аббревиатурой англоязычных названий единиц административно-территориального деления территории государства, региона, района, области, провинции, графства, города, части города и т. п.

ISO 3166-2 is het tweede gedeelte van de ISO 3166-standaard en definieert de codes voor de namen van de belangrijkste deelsectoren (bijvoorbeeld provincies of staten) van alle landen die gecodeerd zijn volgens ISO 3166-1. De officiële naam van deze standaard is de Codes for the representation of names of countries and their subdivisions – Part 2: Country subdivision code, vrij vertaald de Codes voor de representatie van namen van landen en hun onderverdelingen. De standaard werd voor het eerst gepubliceerd in 1998. Het doel van ISO 3166-2 is het vaststellen van een internationale standaard van korte en unieke alfanumerieke codes die de desbetreffende administratieve onderdelen van alle landen representeren in een eenvoudige en minder dubbelzinnige vorm dan hun volledige naam. Elke volledige ISO 3166-2-code bestaat uit twee delen, gescheiden door een koppelteken: 
* Het eerste deel is de ISO 3166-1 alfa-2-code van het land; 
* Het tweede deel is een reeks van maximaal drie alfanumerieke tekens, die meestal worden verkregen uit nationale bronnen en vloeit voort uit codeersystemen die al in gebruik zijn in het betrokken land, maar kunnen ook worden ontwikkeld door de ISO 3166 Maintenance Agency (ISO 3166/MA) zelf. Elke volledige ISO 3166-2-code kan vervolgens worden gebruikt om op unieke wijze een belangrijk administratief onderdeel te identificeren in een mondiale context. Momenteel zijn er meer dan 4200 codes gedefinieerd in ISO 3166-2. Voor sommige landen zijn er codes gedefinieerd voor meer dan slechts één niveau van administratieve onderdelen in dat land. Deze codes voor onderdelen van een land op een hoger gelegen niveau worden gedefinieerd volgens de officiële standaard zonder de ISO 3166-1 alfa-2-code van een land als voorvoegsel. Hierdoor kunnen deze codes geen garantie bieden voor wereldwijde uniciteit als opzichzelfstaande codes. Echter kunnen deze codes worden aangevuld door toevoeging van de alfa-2-code.

